from dataclasses import dataclass
from typing import TypedDict, Union

from stw_py_api_runtime.gen_shared_types.basic_types import *
from stw_py_api_runtime.gen_classes.telemetry.parse import Message as _Message


from stw_py_api_runtime.gen_shared_types.types.core.time.up_type import Up


@dataclass
class ActiveEvent(_Message):

    # Идентификатор события
    msgid: uint32_t
    # Время первого возникновения
    ts: Up
    # Количество возникших событий
    count: uint32_t


class ActiveEventDict(TypedDict):

    # Идентификатор события
    msgid: Union[uint32_t, int ]

    # Время первого возникновения
    ts: Union[Up]

    # Количество возникших событий
    count: Union[uint32_t, int ]

